import { useState, useLayoutEffect, useRef, useReducer, useEffect } from "react";
import { Link } from "react-router-dom";
import { Container, Row } from "../GlobalStyle";
import * as H from "./style";
import "./header.scss";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faBars, faTimes } from '@fortawesome/free-solid-svg-icons';

function useWindowSize() {
    const [size, setSize] = useState([0,0]);
    useLayoutEffect(() => {
        function updateSize() {
            setSize([window.innerWidth, window.innerHeight]);
        }
        window.addEventListener('resize', updateSize);
        return () => {
            window.removeEventListener('resize', updateSize);
        }
    }, []);
    return size;
}

function Header() {
    const [show, setShow] = useState(false);
    const showMenu = () => {
        setShow(!show);
    }
    useEffect(() => {
      // console.log("after setShow: ",show);
      // console.log(initialState.about, state.about, initialState.ourteam, state.ourteam);
    });
    const initialState = { 
      about: false,
      ourteam: false
    };
    const [state, dispatch] = useReducer(reducer, initialState);
    function reducer(state, action) {
      switch (action.type) {
        case "about": 
          return { ...state, about: !state.about, ourteam: false };
        case "ourteam" :
          return { ...state, about: false, ourteam: !state.ourteam };
        default:
          return initialState;
      }
    }

    const showItem = () => {
      dispatch({type: "about"});
    }
    const showItemOurTeam = () => {
      dispatch({type: "ourteam"});
    }
    const [width, height] = useWindowSize();
    if(width >= 992 && show) {
        setShow(false);
    }
    return (
    <>
      <H.Header style={{paddingBottom: show ? "0" : "10px"}}>
        <Container>
          <Row spaceBetween alignItemsCenter>
            <H.LogoDiv>
              <a href="/">
                <H.Logo alt="site-logo" src="https://movephysiotherapy.com.au/wp-content/uploads/2021/05/Move_P_F_Logo-Black_Blue-removebg-preview.png"></H.Logo>
              </a>
            </H.LogoDiv>
            <H.MenuWrapper>
              <H.MenuList level_0 className="level-0">
                  <H.MenuItem className="expandable">
                    <Link to="/about">About</Link>
                    <H.MenuList className="level-1">
                      <H.MenuItem className="expandable">
                        <Link to="/ourteam">Our Team</Link>
                        <H.MenuList className="level-2">
                          <H.MenuItem><Link to="/physiotherapists">Physiotherapists</Link></H.MenuItem>
                          <H.MenuItem><Link to="/remedial-massage-therapist">Remedial Massage Therapist</Link></H.MenuItem>
                        </H.MenuList>
                      </H.MenuItem>
                      <H.MenuItem><Link to="/pricing">Pricing</Link></H.MenuItem>
                    </H.MenuList>
                  </H.MenuItem>
                  <H.MenuItem>
                    <Link to="/services">Services</Link>
                  </H.MenuItem>
                  <H.MenuItem>
                    <Link to="/conditions">Conditions</Link>
                  </H.MenuItem>
                  <H.MenuItem>
                    <Link to="/blog">Blog</Link>
                  </H.MenuItem>
                  <H.MenuItem>
                    <Link to="/projects">Projects</Link>
                  </H.MenuItem>
                  <H.MenuItem>
                    <Link to="/contact">Contact</Link>
                  </H.MenuItem>
              </H.MenuList>
            </H.MenuWrapper>
            <H.MenuButton className="menuBtn" onClick={showMenu}>
              <FontAwesomeIcon icon={show ? faTimes: faBars} />
            </H.MenuButton>
          </Row>
        </Container>
        <H.MobileMenuWrapper style={{display: show ? "block" : "none"}}>
            <H.MobileMenuList className="mlevel-0">
              <H.MobileMenuItem>
                <Link to="/about">About About About About About About About</Link>
                <div className="dropdownBtn" onClick={showItem}></div>
                <H.MobileMenuList className="mlevel-1" style={{display: state.about ? "flex": "none"}}>
                    <H.MobileMenuItem>
                    <Link to="/ourteam">Our Team</Link>
                    <div className="dropdownBtn" onClick={showItemOurTeam}></div>
                    <H.MobileMenuList className="mlevel-2">
                        <H.MobileMenuItem><Link to="/physiotherapists">Physiotherapists</Link></H.MobileMenuItem>
                        <H.MobileMenuItem><Link to="/remedial-massage-therapist">Remedial Massage Therapist</Link></H.MobileMenuItem>
                    </H.MobileMenuList>
                    </H.MobileMenuItem>
                    <H.MobileMenuItem><Link to="/pricing">Pricing</Link></H.MobileMenuItem>
                </H.MobileMenuList>
              </H.MobileMenuItem>
              <H.MobileMenuItem>
                <Link to="/services">Services</Link>
              </H.MobileMenuItem>
              <H.MobileMenuItem>
                <Link to="/conditions">Conditions</Link>
              </H.MobileMenuItem>
              <H.MobileMenuItem>
                <Link to="/blog">Blog</Link>
              </H.MobileMenuItem>
              <H.MobileMenuItem>
                <Link to="/projects">Projects</Link>
              </H.MobileMenuItem>
              <H.MobileMenuItem>
                <Link to="/contact">Contact</Link>
              </H.MobileMenuItem>
              </H.MobileMenuList>
          </H.MobileMenuWrapper>
      </H.Header>
    </>
    );
}

export default Header;
